INSERT INTO `oxartextends` (`OXID`, `OXLONGDESC`, `OXLONGDESC_1`, `OXLONGDESC_2`, `OXLONGDESC_3`) VALUES
('1849', '<div>Für 6 Flaschen. </div>\r\n<div>&nbsp;</div>\r\n<div>Höhe: 52 cm <br>\r\nMaterial: Chrom</div>\r\n<div>&nbsp;</div>\r\n<div><span style="color: #666666;"><strong>Bezugshinweis:</strong> bei Interesse können Sie dieses Produkt bei <a href="http://www.desaster.com/" style="color: #666666;">www.desaster.com</a> erwerben.</span></div>', '<P>A bar butler for six bottles.</P>\r\n<P>Height: 20.5 inch<BR>\r\nMaterial: chrome</P>\r\n\r\n<P><STRONG><FONT COLOR="#666666">Where to\r\nbuy:</FONT></STRONG><FONT COLOR="#666666"> If you are interested you\r\ncan purchase this product at <A HREF="http://www.desaster.com/">www.desaster.com</A></FONT></P>', '', ''),
('1126', '<div>Der Zauber der "grünen Fee" (das heisst Absinth übersetzt) ist mal wieder legal! Keiner weiss so genau, was sich hinter den wilden Geschichten verbirgt. Schon viele Intellektuelle vor dir, von Hemingway bis Oscar Wild, haben sich seit dem 18. Jahrhundert von dem teuflischen Getränk um den Verstand bringen lassen. Alles für das sehr spezielle Trink-Ritual und noch einige Rezepte dazu, stecken in unserem Barset ABSINTH. All inclusive sozusagen. </div>\r\n<div>&nbsp;</div>\r\n<div><strong>Ab 18 Jahren!</strong><br>\r\n<br>\r\nInhalt:<br>\r\n2 Absinth Gläser<br>\r\n1 Absinthlöffel Devil<br>\r\n2 Fläschchen Absinth (je 4 cl)</div>\r\n<div>&nbsp;</div>\r\n<div><span style="color: #666666;"><strong>Bezugshinweis:</strong> bei Interesse können Sie dieses Produkt bei <a href="http://www.desaster.com/" style="color: #666666;">www.desaster.com</a> erwerben.</span></div>', '<P>The magic of the "green fairy" (this is what ABSINTHE\r\nmeans translated) is legal again! No one knows what exactly \r\nis behind the wild stories. But a lot of intellectuals before\r\nyou, like Hemingway and Oscar Wilde, have gone mad since the 18th century\r\ndrinking this devilish stuff. You will find everything for this very\r\nspecial drinking ritual and additional some recipes in our bar-set\r\nABSINTH, An all-inclusive set. \r\n</P>\r\n<P><STRONG>For adults only!</STRONG></P>\r\n<P>Contents:<BR>2 Absinth glasses<BR>1 Absinth spoon "Devil"<BR>2\r\nphials of Absinth (1.35 oz each)</P>\r\n<P><STRONG><FONT COLOR="#666666">Where to buy:</FONT></STRONG><FONT COLOR="#666666">\r\nIf you are interested you can purchase this product at\r\n<A HREF="http://www.desaster.com/">www.desaster.com</A></FONT></P>', '', ''),
('2080', '<p>Die kleine Zange zeichnet sich durch funktionales Design aus. Dadurch entfernt sie ideal nicht nur den Verschlussdraht von Flaschen, sondern ist bestens dazu geeignet festsitzende Champagner-und Sektkorke sowie Schraubverschlüsse einfach zu öffnen. </p>\r\n<p>Schnelle Hilfe bietet die Barzange ebenfalls als Kapselhebel und auch als Deckelheber für Schraubgläser: Deckel anheben, Luft hineinlassen und ohne Kraftaufwand das Glas aufschrauben.</p>\r\n<div>Design: Numsen<br>\r\n<div>Edler Zinkdruckguß + satiniert.<br>\r\nMasse: 16,9 cm x 4,3 cm x 2,3 cm.<br>\r\nGewicht: 268g</div></div>\r\n<div>&nbsp;</div>\r\n<div><span style="color: #666666;"><strong>Bezugshinweis:</strong> bei Interesse können Sie dieses Produkt bei <a href="http://www.desaster.com/" style="color: #666666;">www.desaster.com</a> erwerben.</span></div>', '<P>This little clamp is characterized by it''s functional design. It is able to remove stuck caps of champagne bottles and screw tops.</P>\r\n<P>It is also an ideal lever for glasses with screw caps: Simply lift the lid, let air in and unscrew the glass without any effort.</P>\r\n\r\n<P>Design: Numsen<BR>\r\nClassy zinc diecasting and satined<BR>\r\nDimensions: 6.7 in x 1.7 in x 0.9 in<BR>\r\nWeight: 9.45 oz</P>\r\n\r\n<P><STRONG><FONT COLOR="#666666">Where to\r\nbuy:</FONT></STRONG><FONT COLOR="#666666"> If you are interested you\r\ncan purchase this product at <A HREF="http://www.desaster.com/">www.desaster.com</A></FONT></P>', '', ''),
('1651', '<div>&nbsp;</div>\r\n<div>Da kann das Bier aus dem Getränkemarkt in Zukunft\r\nnicht mehr mithalten. Dein edles Gebräu Marke ''Do it yourself'' ist ein\r\nriesen Partyspaß und schmeckt sogar richtig gut! Das Set PROSIT\r\nenthält alles was Du zur Herstellung von ca. 25 Liter naturtrübem Bier\r\nbrauchst.</div>\r\n<div>&nbsp;</div>\r\n<div><span style="color: #666666;"><strong>Bezugshinweis:</strong> bei Interesse können Sie dieses Produkt bei <a href="http://www.desaster.com/" style="color: #666666;">www.desaster.com</a> erwerben.</span></div>', '<P>Forget your local supermarket. With the Beer home-brew kit CHEERS\r\nyou will have great fun at your party, no hauling and a really\r\ntasty home-made beer. The kit lasts for approx. 6.60 gallons.</P>\r\n\r\n<P><STRONG><FONT COLOR="#666666">Where to\r\nbuy:</FONT></STRONG><FONT COLOR="#666666"> If you are interested you\r\ncan purchase this product at <A HREF="http://www.desaster.com/">www.desaster.com</A></FONT></P>', '', ''),
('1127', '<div>Schön geglitzert hat Eis ja schon immer, aber dieses hier bietet nochmals eine andere Dimension! Einige Stunden vorher ins Gefrierfach gepackt, fangen die Eiswürfel FLASH beim Kontakt mit dem Drink an wie wild zu blinken. Ausgeschaltet werden sie, indem du sie einfach abtrocknest. Ca. 100 Stunden lang kannst du das Schauspiel bewundern. Das sind, je nach Trinkgfestigkeit deiner Gäste, eine ganze Menge Partys.<br>\r\n<br>\r\nInhalt: 2 Stück im Set</div>\r\n<div>&nbsp;</div>\r\n<div><span style="color: #666666;"><strong>Bezugshinweis:</strong> bei Interesse können Sie dieses Produkt bei <a href="http://www.desaster.com/" style="color: #666666;">www.desaster.com</a> erwerben.</span></div>', '<P>Ice glitters really nice but this one offers new dimensions! Put\r\nyour Ice Cubes FLASH to the freezer a few hours before and they will\r\nstart flashing in your drink. Turn them off by simply drying them. You\r\ncan marvel this spectacle over approx. 100 hours. This is a lot of parties\r\ndepending on your guests steadiness.<BR><BR>Contents: 2 pieces in a\r\nset</P>\r\n<P><STRONG><FONT COLOR="#666666">Where to buy:</FONT></STRONG><FONT COLOR="#666666">\r\nIf you are interested you can purchase this product at\r\n<A HREF="http://www.desaster.com/">www.desaster.com</A></FONT></P>', '', ''),
('2036', '<div>&nbsp;</div>\r\n<div>Material Chrome&nbsp; </div>\r\n<div>&nbsp;</div>\r\n<div>Höhe: 22cm, Durchmesser: 8cm</div>\r\n<div>&nbsp;</div>\r\n<div><span style="color: #666666;"><strong>Bezugshinweis:</strong> bei Interesse können Sie dieses Produkt bei <a href="http://www.desaster.com/" style="color: #666666;">www.desaster.com</a> erwerben.</span></div>', '<P>Material: Chrome<BR>\r\nHeight: 8.7 inch<BR>\r\nDiameter: 3.1 inch</P>\r\n\r\n<P><STRONG><FONT COLOR="#666666">Where to\r\nbuy:</FONT></STRONG><FONT COLOR="#666666"> If you are interested you\r\ncan purchase this product at <A HREF="http://www.desaster.com/">www.desaster.com</A></FONT></P>', '', ''),
('1431', '<div>Nicht nur für liebliche Drinks! Du packst sie so wie sie sind ins Gefrierfach und dann ab damit ins Glas. Kein lästiges eingiessen von Wasser in irgendwelche Formen. Darüberhinaus gehören verwässerte Drinks damit der Vergangenheit an!</div>\r\n<div>Menge: 18 Stück</div>\r\n<div>&nbsp;</div>\r\n<div><span style="color: #666666;"><strong>Bezugshinweis:</strong> bei Interesse können Sie dieses Produkt bei <a href="http://www.desaster.com/" style="color: #666666;">www.desaster.com</a> erwerben.</span></div>', '<P>Not only for lovely drinks! Just put them to your freezer. No\r\ninconvenient filling of water and no washy drinks any longer!</P>\r\n<P>Contents: 18 pieces</P>\r\n\r\n<P><STRONG><FONT COLOR="#666666">Where to\r\nbuy:</FONT></STRONG><FONT COLOR="#666666"> If you are interested you\r\ncan purchase this product at <A HREF="http://www.desaster.com/">www.desaster.com</A></FONT></P>', '', ''),
('1142', '<div>Das richtige Werkzeug für den Feierabend. Also die Jungs draussen auf dem Bau nehmen ja normalerweise eine zweite Flasche um die erste zu köpfen. Aber das wollen wir euch nicht wirklich antun. </div>\r\n<div>Dann sind die Heimwerker also einfach mal einen Schritt voraus.</div>\r\n<div>&nbsp;</div>\r\n<div><span style="color: #666666;"><strong>Bezugshinweis:</strong> bei Interesse können Sie dieses Produkt bei <a href="http://www.desaster.com/" style="color: #666666;">www.desaster.com</a> erwerben.</span></div>', '<P STYLE="margin-bottom: 0in">"It''s been a hard day''s night and\r\nyou''ve been working like a dog..." After a long day''s work, one\r\ncan build up quite a thirst. But luckily your trusty hammer is nearby\r\nto pop open your next cold one. Fully functional, this hammer can be\r\nused to both nail items into the wall and easily open any bottle\r\nvia it''s unique built in bottle opener. We find it especially handy\r\nafter we''ve thwacked our fingers a few times; nothing eases the pain\r\nquite like an ice cold beer! Stainless steel construction with a\r\nrubber grip, measures 8.5'''' long.</P>\r\n<P STYLE="margin-bottom: 0in"><BR>\r\n</P>\r\n<P STYLE="margin-bottom: 0in"><STRONG><FONT COLOR="#666666">Where to\r\nbuy:</FONT></STRONG><FONT COLOR="#666666"> If you are interested you\r\ncan purchase this product at <A HREF="http://www.desaster.com/">www.desaster.com</A></FONT></P>', '', ''),
('1131', '<div>Die Lösung nicht nur für WGs oder brüchige Partnerschaften. Du kannst sehr gut die Flasche mit dem edlen Tropfen auch vor dir selbst schützen. Einfach den Flaschenverschluss EGO drauf, die Zahlenkombination verstellen und dann schnell aus dem Kopf damit...</div>\r\n<div>&nbsp;</div>\r\n<div><span style="color: #666666;"><strong>Bezugshinweis:</strong> bei Interesse können Sie dieses Produkt bei <a href="http://www.desaster.com/" style="color: #666666;">www.desaster.com</a> erwerben.</span></div>', '<P>The ultimate solution not only for flat-sharing communities or\r\nperished partnerships. You can protect the bottle even from\r\nyourself. Simply put the bottle cap EGO on it, adjust the combination\r\nlock and forget the numbers immediately ...</P>\r\n<P><STRONG><FONT COLOR="#666666">Where to buy:</FONT></STRONG><FONT COLOR="#666666">\r\nIf you are interested you can purchase this product at\r\n<A HREF="http://www.desaster.com/">www.desaster.com</A></FONT></P>', '', ''),
('1952', '<div>Erste Hilfe für den Morgen danach. Einfach Eis in den Beutel füllen und ab damit auf das schmerzende Haupt! </div>\r\n<div>&nbsp;</div>\r\n<div>Durchmesser: 20 cm</div>\r\n<div>&nbsp;</div>\r\n<div><span style="color: #666666;"><strong>Bezugshinweis:</strong> bei Interesse können Sie dieses Produkt bei <a href="http://www.desaster.com/" style="color: #666666;">www.desaster.com</a> erwerben.</span></div>', '<P>First aid for the morning after. Fill ice in the bag and put it to your hurting head.</P>\r\n<P>Measures 7.9 inch</P>\r\n\r\n<P><STRONG><FONT COLOR="#666666">Where to\r\nbuy:</FONT></STRONG><FONT COLOR="#666666"> If you are interested you\r\ncan purchase this product at <A HREF="http://www.desaster.com/">www.desaster.com</A></FONT></P>', '', ''),
('1906', '<div>&nbsp;</div>\r\n<div>Origineller Korkenzieher zum Öffnen von Weinflaschen. Funktioniert mit verblüffend wenig Kraft. </div>\r\n<div>&nbsp;</div>\r\n<div>Material: verchromter Stahl </div>\r\n<div>&nbsp;</div>\r\n<div>Abmessungen: 20,9 * 8 * 4,4 cm Gewicht: ca. 420 g</div>\r\n<div>&nbsp;</div>\r\n<div><span style="color: #666666;"><strong>Bezugshinweis:</strong> bei Interesse können Sie dieses Produkt bei <a href="http://www.desaster.com/" style="color: #666666;">www.desaster.com</a> erwerben.</span></div>', '<P>A fancy corkscrew for opening wine bottles. Works even with little effort.</P>\r\n<P>Material: chrome-plated steel<BR>\r\nDimensions: 8.2 x 3.1 x 1.7 inch<BR>\r\nWeight: approx. 14.8 ounces</P>\r\n\r\n<P><STRONG><FONT COLOR="#666666">Where to\r\nbuy:</FONT></STRONG><FONT COLOR="#666666"> If you are interested you\r\ncan purchase this product at <A HREF="http://www.desaster.com/">www.desaster.com</A></FONT></P>', '', ''),
('1351', '<div>Leg sie einfach einige Stunden vor Gebrauch ins Gefrierfach und serviere deine Drinks mit 2-3 Steinen im Glas. Der riesen Vorteil: Du hast keine verwässerten Cocktails mehr.<br>\r\n</div>\r\n<div>Inhalt: 8 Stück</div>\r\n<div>&nbsp;</div>\r\n<div>Bezugshinweis: bei Interesse können Sie dieses Produkt bei <a title="http://www.desaster.com" href="http://www.desaster.com/">www.desaster.com</a> erwerben. </div>', '<P>A crazy and brilliant idea for your\r\nparty! This ice cubes are made of Swedish rocks. Just store them for a couple\r\nhours before your party in your freezer and put 2 or 3 of them to\r\nyour &#8220;Flintstones Cocktail&#8221;.<BR></P>\r\n\r\n<P>Contents: 8 pieces</P>\r\n\r\n<P><STRONG><FONT COLOR="#666666">Where to\r\nbuy:</FONT></STRONG><FONT COLOR="#666666"> If you are interested you\r\ncan purchase this product at <A HREF="http://www.desaster.com/">www.desaster.com</A></FONT></P>\r\n', '', ''),
('1964', '<div>Ein authentisches Glanzstück seiner Zeit und eine garantierte Augenweide bei deiner nächsten Beach-Party. Mit Originalzertifikat vom Hersteller BUSH. </div>\r\n<div><br>\r\nGrösse ca. 35 x 9 x 23 cm<br>\r\nBetrieb über 230 V Anschlusskabel (beiligend) oder Batterie Typ PP9.</div>\r\n<div>\r\n<ul>\r\n<li>3-Band Radio (FM/AM/LW) </li>\r\n<li>grosse Frequenzskala </li>\r\n<li>Klangregler </li>\r\n<li>230 V Steckerkabel</li></ul></div>\r\n<div>&nbsp;</div>\r\n<div><span style="color: #666666;"><strong>Bezugshinweis:</strong> bei Interesse können Sie dieses Produkt bei <a href="http://www.desaster.com/" style="color: #666666;">www.desaster.com</a> erwerben.</span></div>', '<P>A highlight is it''s  authentic age and it''s guaranteed eye candy for your next beach party. Comes with an original manufacturer''s certificate BUSH.</P>\r\n<P>Size: approx. 13.8 x 3.5 x 9.1 inch<br>\r\nOperating over a 230 V power cord (enclosed) or a type PP9 battery</P>\r\n\r\n<ul>\r\n<li>3 band radio (FM/AM/LW) </li>\r\n<li>huge frequency scale</li>\r\n<li>sound control</li>\r\n<li>230 V power cord</li></ul>\r\n\r\n<P><STRONG><FONT COLOR="#666666">Where to\r\nbuy:</FONT></STRONG><FONT COLOR="#666666"> If you are interested you\r\ncan purchase this product at <A HREF="http://www.desaster.com/">www.desaster.com</A></FONT></P>', '', ''),
('2025', '<div>&nbsp;</div>\r\n<div>Höhe: 32 cm</div>\r\n<div>&nbsp;</div>\r\n<div><span style="color: #666666;"><strong>Bezugshinweis:</strong> bei Interesse können Sie dieses Produkt bei <a href="http://www.desaster.com/" style="color: #666666;">www.desaster.com</a> erwerben.</span></div>', '<P>Height: 12.6 inch</P>\r\n\r\n<P><STRONG><FONT COLOR="#666666">Where to\r\nbuy:</FONT></STRONG><FONT COLOR="#666666"> If you are interested you\r\ncan purchase this product at <A HREF="http://www.desaster.com/">www.desaster.com</A></FONT></P>', '', ''),
('2024', '<div>Riesengroße pinke Schale im Popcorn-Design. </div>\r\n<div>&nbsp;</div>\r\n<div>Durchmesser: 25,5 cm</div>\r\n<div>&nbsp;</div>\r\n<div><span style="color: #666666;"><strong>Bezugshinweis:</strong> bei Interesse können Sie dieses Produkt bei <a href="http://www.desaster.com/" style="color: #666666;">www.desaster.com</a> erwerben.</span></div>', '<P>A huge pink bowl in a fancy popcorn design.</P>\r\n<P>Diameter: 10 inches</P>\r\n\r\n<P><STRONG><FONT COLOR="#666666">Where to\r\nbuy:</FONT></STRONG><FONT COLOR="#666666"> If you are interested you\r\ncan purchase this product at <A HREF="http://www.desaster.com/">www.desaster.com</A></FONT></P>', '', ''),
('1940', '<div>&nbsp;</div>\r\n<div>Ein grooviges Plätzchen für Obst und mehr! Die Schale ist hergestellt aus einer alten original Langspielplatte.</div>\r\n<div>&nbsp;</div>\r\n<div><span style="color: #666666;"><strong>Bezugshinweis:</strong> bei Interesse können Sie dieses Produkt bei <a href="http://www.desaster.com/" style="color: #666666;">www.desaster.com</a> erwerben.</span></div>', '<P>A cool place for fruit and other stuff. The dish is made from a real LP.<P>\r\n\r\n<P><STRONG><FONT COLOR="#666666">Where to\r\nbuy:</FONT></STRONG><FONT COLOR="#666666"> If you are interested you\r\ncan purchase this product at <A HREF="http://www.desaster.com/">www.desaster.com</A></FONT></P>', '', ''),
('1477', '<div>Wenn du bereits einen Golfball unter dem Kopfkissen liegen hast, dann wird dich sicher auch unser Champagnerverschluss GOLF erfreuen. Er arbeitet zuverlässig nach dem ''Silberlöffelprinzip'' und ist richtig massiv gebaut.</div>\r\n<div>&nbsp;</div>\r\n<div>Abmessungen: 11 * 4 cm</div>\r\n<div>&nbsp;</div>\r\n<div><span style="color: #666666;"><strong>Bezugshinweis:</strong> bei Interesse können Sie dieses Produkt bei <a href="http://www.desaster.com/" style="color: #666666;">www.desaster.com</a> erwerben.</span></div>', '<P>You will like our Champagne Lock GOLF if you are a Golf lover. It works like a silver spoon and is build of massive stainless steel.</P>\r\n<P>Dimensions: 4.33 x 1.6 inch</P>\r\n\r\n<P><STRONG><FONT COLOR="#666666">Where to\r\nbuy:</FONT></STRONG><FONT COLOR="#666666"> If you are interested you\r\ncan purchase this product at <A HREF="http://www.desaster.com/">www.desaster.com</A></FONT></P>', '', ''),
