('1951', '<div>&nbsp;</div>\r\n<div>Bella Italia, wir kommen! Dieser Ausblick, frisch wie der junge\r\nMorgen versüsst die Stunden, Minuten und Sekunden bis zum nächsten\r\nUrlaub vor der Küste Jesolos. </div>\r\n<div>&nbsp;</div>\r\n<div>Durchmesser: 34 cm </div>\r\n<div>&nbsp;</div>\r\n<div>Material: Glas</div>\r\n<div>&nbsp;</div>\r\n<div><span style="color: #666666;"><strong>Bezugshinweis:</strong> bei Interesse können Sie dieses Produkt bei <a href="http://www.desaster.com/" style="color: #666666;">www.desaster.com</a> erwerben.</span></div>', '<P>A great clock for any collector</P>\r\n<P>Measures 13.4'''' diameter<BR>\r\nMaterial: Glas</P>\r\n\r\n<P><STRONG><FONT COLOR="#666666">Where to\r\nbuy:</FONT></STRONG><FONT COLOR="#666666"> If you are interested you\r\ncan purchase this product at <A HREF="http://www.desaster.com/">www.desaster.com</A></FONT></P>', '', ''),
