('d8842e3cbb8ac9238.37666205', '<div>Aus der "Beauties of Fantasy" - Dolchkollektion, designed von Boris Vallejo.\r\n<table cellspacing="0" cellpadding="0" align="left" border="0">\r\n<tbody>\r\n<tr>\r\n<td><br>\r\n</td></tr></tbody></table>Sinnlich und gefährlich erotisch, verhext eine Medusa Männer zu Stein, wenn sie von ihnen angesehen wird. Dem Fantasy-Künstler Boris Vallejo gelingt es, ihr reizvolles Äusseres auf einem sensationellen Sammlermesser zu bannen. Geformt in atemberaubenden Details, schlängeln sich hypnotisierende Schlangen von ihrem Kopf. Ein grossartiges Meisterwerk in der Tradition der Fantasykunst. Einfach unwiderstehlich. </div>\r\n<div>\r\n<ul>\r\n<li><strong>Material:</strong> Knauf hochwertige Zinn-Skulptur, Klinge rostfreier Stahl, 24Karat teilvergoldet! </li>\r\n<li><strong>Grösse:</strong> Gesamtlänge ca. 30 cm </li>\r\n<li><strong>Weiterhin:</strong> Inklusive hochwertigem Ständer zur Präsentation des Dolches!</li></ul><span style="color: #666666;"><strong>Bezugshinweis:</strong> bei Interesse können Sie dieses Produkt bei <a href="http://www.mmog-shop.de"><span style="color: #666666;">www.mmog-shop.de</span></a> erwerben.</span><br>\r\n </div>', '<P>From the "Beauties of Fantasy" dagger collection designed by Boris Vallejo.\r\n\r\nSensuous and dangerously erotic, Medusa puts a spell on men by catching their eyes. The fantasy artist Boris Vallejo succeeds in capturing her sexy appearance in a sensational collectible knife. Formed in stunning detail, mesmerizing snakes curl on her head. A great masterpiece in the tradition of fantasy art. Simply irresistible.\r\n\r\n<UL>\r\n<LI><STRONG>Material:</STRONG> Blade of stainless steel, handle made of pure tin, 24 karat gold plated</LI>\r\n<LI><STRONG>Length:</STRONG> 33 cm</LI>\r\n<LI><STRONG>Furthermore:</STRONG> Includes presentation stand and certificate of authenticity</LI>\r\n</UL>\r\n\r\n<P><STRONG><FONT COLOR="#666666">Where to\r\nbuy:</FONT></STRONG><FONT COLOR="#666666"> If you are interested you\r\ncan purchase this product at <A HREF="http://www.desaster.com/">www.desaster.com</A></FONT></P>', '', ''),
