('531f91d4ab8bfb24c4d04e473d246d0b', '<div style="font: 12px ''Lucida Grande'', Lucida, Verdana, sans-serif">Die modische und schmale Herrenjeans von Kuyichi. Schmale  Low Boot Jeans mit geradem Beinschnitt. Gefertigt ist die Jeans aus 16/23 Rusty Denim in dunkler Waschung mit markant starkem Abrieb und aufwändig, von Hand gearbeiteten Used-Effekten.<br />\r\n<br /><strong>100% ökologisch angebaute Baumwolle, 100% Fair Trade.</strong><br />\r\n<br /><strong>Bezugshinweis:</strong> bei Interesse können Sie dieses Produkt bei <a href="http://www.true-fashion.com" alt="true-fashion">www.true-fashion.com</a> erwerben.</div>', '<p><span id="goog-gtc-unit-2" class="goog-gtc-unit"><span dir="ltr" class="goog-gtc-translatable goog-gtc-from-human">Stylish and slim men''s jeans from Kuyichi.&nbsp;</span></span><span id="goog-gtc-unit-3" class="goog-gtc-unit"><span dir="ltr" class="goog-gtc-translatable goog-gtc-from-human">Narrow low boot cut Jeans with straight legs.&nbsp;</span></span><span id="goog-gtc-unit-4" class="goog-gtc-unit"><span dir="ltr" class="goog-gtc-translatable goog-gtc-from-human">These jeans are made from 16/23 rusty dark wash denim and have strikingly strong abrasion with hand-crafted used effects.</span></span></p>\r\n<p><strong>100% organic cotton, 100% Fair Trade.</strong></p>\r\n<p><strong>Reference Note:</strong> if you are interested you can purchase this product at <a href="http://www.true-fashion.com" title="" target="_blank">www.true-fashion.com</a>.</p>', '', ''),
