('531b537118f5f4d7a427cdb825440922', '<div style="font: 12px ''Lucida Grande'', Lucida, Verdana, sans-serif">Eine lockere und lässige Damenjeans von Kuyichi mit individuell einstellbarem Bund und lockerer Passform, gerade geschnitten.<br />\r\n<br /><strong>100% ökologisch angebaute Baumwolle, 100% Fair Trade.</strong><br />\r\n<br /><strong>Bezugshinweis:</strong> bei Interesse können Sie dieses Produkt bei <a href="http://www.true-fashion.com" alt="true-fashion">www.true-fashion.com</a> erwerben.</div>', '<p>Cool and casual women''s jeans from Kuyichi with individually adjustable waist and loose fit, straight cut.</p>\r\n<p><strong>100% organic cotton, 100% Fair Trade.</strong></p>\r\n<p><strong>Reference Note:</strong> If you are interested you can purchase this product at <a href="http://www.true-fashion.com" title="" target="_blank">www.true-fashion.com</a>.</p>', '', ''),
