('6b6e718666bc8867719ab25a8020a978', '<div style="font: 12px ''Lucida Grande'', Lucida, Verdana, sans-serif">Hochwertige Kuyichi Jacke aus vegetable-tanned leather. Das Leder wurde ohne Chrom und nur mit pflanzliche Mittel gegerbt. Mit dieser Gerbmethode wird die Umwelt geschont und das Material ist dadurch besonders verträglich und geschmeidig. Die Jacke weist einen raffinierter Doppelkragen und Ripp-Bündchen an Säumen und Kragen auf.<br />\r\n<strong><br />\r\n</strong></div>\r\n<div style="font: 12px ''Lucida Grande'', Lucida, Verdana, sans-serif"><strong>100% ökologisch angebaute Baumwolle, 100% Fair Trade.</strong><br />\r\n<br /><strong>Bezugshinweis:</strong> bei Interesse können Sie dieses Produkt bei <a href="http://www.true-fashion.com" alt="true-fashion">www.true-fashion.com</a> erwerben.</div>', '<p><span id="goog-gtc-unit-20" class="goog-gtc-unit"><span dir="ltr" class="goog-gtc-translatable goog-gtc-from-human">High quality Kuyichi Jacket from vegetable-tanned leather.&nbsp;</span></span><span id="goog-gtc-unit-21" class="goog-gtc-unit"><span dir="ltr" class="goog-gtc-translatable goog-gtc-from-human">This tanning method is ecological and the material will become especially flexible.&nbsp;</span></span><span id="goog-gtc-unit-22" class="goog-gtc-unit"><span dir="ltr" class="goog-gtc-translatable goog-gtc-from-human">This jacket has got a clever collar and cuffs on the seams.</span></span>&nbsp;</p>\r\n<p><strong>100% organic cotton, 100% Fair Trade.</strong></p>\r\n<p><strong>Reference Note:</strong> if you are interested you can purchase this product at <a href="http://www.true-fashion.com" title="" target="_blank">www.true-fashion.com</a>.</p>', '', ''),
('6b6099c305f591cb39d4314e9a823fc1', '<div style="font-family: ''Lucida Grande'',Lucida,Verdana,sans-serif; font-style: normal; font-variant: normal; font-weight: normal; font-size: 12px; line-height: normal; font-size-adjust: none; font-stretch: normal; -x-system-font: none">Stewart&amp;Brown Shirt Kisser Fish, langes Shirt mit kurzen Ärmeln und farbigem Aufdruck, das auch auch als Mini-Kleid getragen werden kann. Erhältlich in den Farben Clover (Klee-Grün) und Violet, aus der exklusiven Stewart+Brown Organic Cotton Linie. Die feinste Pima Baumwolle besteht aus besonders langstapeligen Fasern, die eine besonders hohe Qualität der Verarbeitung ermöglichen.<br />\r\n<br /><strong>100% ökologisch angebaute Baumwolle, 100% Fair Trade.</strong><br />\r\n<br /><strong>Bezugshinweis:</strong> bei Interesse können Sie dieses Produkt bei <a href="http://www.true-fashion.com" alt="true-fashion">www.true-fashion.com</a> erwerben.</div>', '<p><span id="goog-gtc-unit-5" class="goog-gtc-unit"><span dir="ltr" class="goog-gtc-translatable goog-gtc-from-human">Kisser Fish Shirt, long shirt with short sleeves and colored printing that can be worn as a mini dress.</span></span>&nbsp;<span id="goog-gtc-unit-6" class="goog-gtc-unit"><span dir="ltr" class="goog-gtc-translatable goog-gtc-from-human">Available in clover green and violet from the exclusive Stewart+Brown Organic Cotton Line.</span></span>&nbsp;<span id="goog-gtc-unit-7" class="goog-gtc-unit"><span dir="ltr" class="goog-gtc-translatable goog-gtc-from-human">The finest Pima cotton consists of especially long fibres that guarantee a special high quality.</span></span></p>\r\n<p><strong>100% organic cotton, 100% Fair Trade.</strong></p>\r\n<p><strong>Reference Note:</strong> if you are interested you can purchase this product at <a href="http://www.true-fashion.com" title="" target="_blank">www.true-fashion.com</a>.</p>', '', ''),
