('6b63f459c781fa42edeb889242304014', '<div style="font: 12px ''Lucida Grande'', Lucida, Verdana, sans-serif">Leichtes, ärmelloses Träger-Longshirt aus Pimabaumwolle für heiße Sommertage oder zum Layering bestens geeignet. Das Shirt kommt aus der exklusiven Stewart+Brown Organic Cotton Linie und verspricht die Verwendung feinster Pima-Baumwolle. Pima Baumwolle besteht aus besonders langstapeligen Fasern, die die hohe Qualität ausmachen.<br />\r\n<br /><strong>100% ökologisch angebaute Baumwolle, 100% Fair Trade.</strong><br />\r\n<br /><strong>Bezugshinweis:</strong> bei Interesse können Sie dieses Produkt bei <a href="http://www.true-fashion.com" alt="true-fashion">www.true-fashion.com</a> erwerben.</div>', '<p><span id="goog-gtc-unit-9" class="goog-gtc-unit"><span dir="ltr" class="goog-gtc-translatable goog-gtc-from-human">Cushy sleeveless long shirt from Pima cotton for hot summer days.&nbsp;</span></span><span id="goog-gtc-unit-10" class="goog-gtc-unit"><span dir="ltr" class="goog-gtc-translatable goog-gtc-from-human">The shirt comes from the exclusive Stewart+Brown Organic Cotton Line and promises finest Pima cotton.&nbsp;</span></span><span id="goog-gtc-unit-11" class="goog-gtc-unit"><span dir="ltr" class="goog-gtc-translatable goog-gtc-from-human">Pima cotton consists of especially long fibres for high quality.</span></span></p>\r\n<p><strong>100% organic cotton, 100% Fair Trade.</strong></p>\r\n<p><strong>Reference Note:</strong> if you are interested you can purchase this product at <a href="http://www.true-fashion.com" title="" target="_blank">www.true-fashion.com</a>.</p>', '', ''),
